function SpreadFieldNameConflictFixed({ utilities, components }) {
  const [orders, setOrders] = useState([]);
  const { DataGrid } = components;

  useEffect(() => {
    async function loadData() {
      const result = await utilities.rv.RunView({ EntityName: 'Orders' });
      if (result?.Success) {
        // âœ… Using unique field name for computed value
        const enhanced = result.Results.map(o => ({
          ...o,
          PaymentStatus: o.IsPaid ? 'Paid' : 'Unpaid' // Unique name
        }));
        setOrders(enhanced);
      }
    }
    loadData();
  }, []);

  return (
    <div>
      <h3>Orders</h3>
      {/* Grid references both original and computed fields */}
      <DataGrid 
        data={orders} 
        columns={[
          {field: 'OrderNumber', title: 'Order'},
          {field: 'Status', title: 'Status'},
          {field: 'PaymentStatus', title: 'Payment'}
        ]} 
      />
    </div>
  );
}
